import types from "./../types/typeOfActions";
import callApi from "./../callApi/callApi";
class Feedback {
  getAllFeedback = () => {
    return async (dispatch) => {
      let result = await callApi(`http://localhost:9000/feedback`);
      console.log(result);
      
    };
  };
}
export default new Feedback();
